const Header = () => {
    return (
        <div className="header-align">
            <div>
                <h1>Galería de imágenes con React.</h1>
                <img src="https://upload.wikimedia.org/wikipedia/commons/e/e2/Mega_man_in-game_logo.jpg" alt="MEgaman logo" width="200px" />
                <iframe width="301" height="201" src="https://www.youtube.com/embed/4uziVEZtcoE" title="Video reportaje: Historia de Megaman - Parte 1 (2/2)" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>           
        </div>
    );
};
export default Header;
